import React, { useState } from "react";
import "../Style.K/Booking.css";
import Navbar from "../components/Navbar";

const BookingPage = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    phone: "",
    make: "",
    model: "",
    year: "",
    date: "",
    comments: "",
  });

  const [showModal, setShowModal] = useState(false); // State for modal visibility
  const [appointmentTime, setAppointmentTime] = useState(""); // State for appointment time

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Make a backend API call to save the appointment (you can uncomment this to make it functional)
    // axios.post("http://localhost:8080/api/appointments", formData)
    //   .then((response) => {
    //     console.log(response.data);
    //   })
    //   .catch((error) => {
    //     console.error("Error booking appointment:", error);
    //   });

    setAppointmentTime(formData.date); // Set the appointment time
    setShowModal(true); // Show the modal popup
  };

  const closeModal = () => {
    setShowModal(false); // Close the modal
  };

  return (
    <div>
      <Navbar />
      <div className="booking-page">
        <form className="booking-form" onSubmit={handleSubmit}>
          <h2>Personal Information</h2>

          <div className="form-group">
            <input
              type="text"
              name="firstName"
              value={formData.firstName}
              onChange={handleChange}
              placeholder="First Name (required)"
              required
            />
            <input
              type="text"
              name="lastName"
              value={formData.lastName}
              onChange={handleChange}
              placeholder="Last Name (required)"
              required
            />
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="Email (required)"
              required
            />
            <input
              type="tel"
              name="phone"
              value={formData.phone}
              onChange={handleChange}
              placeholder="Phone (required)"
              required
            />
          </div>

          <h2>Car Details</h2>
          <div className="form-group">
            <input
              type="text"
              name="make"
              value={formData.make}
              onChange={handleChange}
              placeholder="Make"
            />
            <input
              type="text"
              name="model"
              value={formData.model}
              onChange={handleChange}
              placeholder="Model"
            />
            <input
              type="text"
              name="year"
              value={formData.year}
              onChange={handleChange}
              placeholder="Year"
            />
          </div>

          <h2>Appointment Information</h2>
          <div className="form-group">
            <input
              type="date"
              name="date"
              value={formData.date}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <textarea
              name="comments"
              value={formData.comments}
              onChange={handleChange}
              placeholder="Comments"
            />
          </div>

          <button type="submit">Submit</button>
        </form>

        <div className="booking-contact-info">
          <h3>Contact Information</h3>
          <p>Phone: 855-3X5-50X3</p>
          <p>Address: 506 Main St. N, Reddeer, Alberta L6V 1P9</p>
          <p>Business Hours:</p>
          <p>Monday - Friday: 9:00AM - 7:00PM</p>
          <p>Saturday: 9:00AM - 5:00PM</p>
          <p>Sunday: Closed</p>
        </div>
      </div>

      {/* Modal Popup */}
      {showModal && (
        <div className="modal-overlay">
          <div className="modal">
            <div className="modal-header">
              <h3>Appointment Confirmed</h3>
            </div>
            <div className="modal-body">
              <p>Your appointment is confirmed for {appointmentTime}!</p>
              <div className="checkmark">
                <span>✔</span>
              </div>
            </div>
            <div className="modal-footer">
              <button onClick={closeModal}>Close</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default BookingPage;
